window.bookSummaryJSON = "<p>The extraordinary daughter of Cleopatra and Mark Anthony seeks to reclaim her birthright in the first novel of an epic historical fiction trilogy from the <i>New York Times</i> best-selling author of <i>America's First Daughter</i>.</p> <p>With both of her parents dead, Princess Selene and her two surviving brothers are left at the mercy of their captors, taken from Egypt and put on display as war trophies in Rome. Trapped in an empire that reviles her heritage and suspects her faith, Selene struggles for survival in a court of intrigue. She can't hide the hieroglyphics that carve themselves into her hands nor can she stop the emperor from using her powers for his own ends.</p> <p>Faced with a new and ruthless Caesar who is obsessed with having a Cleopatra of his very own, Selene is determined to resurrect her mother's dreams and succeed where she failed. But there's no telling what success will cost her in a treacherous political game where the only rule is win or die.</p>"; 
